import styled from "styled-components";
import { Link } from "react-router-dom";

export const Container = styled.div`
  width: 800px;
  height:auto;
  /* background-color: #ddd; */
  margin:10px;
  /* border-radius:5px; */
`;

export const LinkRoute = styled(Link)`
  display:inline;
  color: black;
  text-decoration: none;
  font-size:10px;
`;
